import logo from './logo.svg';
import { useState } from 'react';
import { useEffect } from 'react';
import Map from 'ol/Map.js';

import MapScreen from './components/MapScreen/MapScreen';
import DexScreen from './components/DexScreen/DexScreen';
import GalleryScreen from './components/GalleryScreen/GalleryScreen';

import './App.css';

function App() {
  const MAP_SCREEN = 0;
  const DEX_SCREEN = 1;
  const GALLERY_SCREEN = 2;
  const screens = [MapScreen, DexScreen, GalleryScreen];
  const [currentScreen, setScreen] = useState(MAP_SCREEN);

  const updateScreen = (screen) => {
    setScreen(screen);
  }
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Thank christ we're in js brother.
        </p>
        <button onClick={() => updateScreen(DEX_SCREEN)}>Motherfucker</button>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
          >
          Learn React
        </a>
      </header>
          {screens[currentScreen]()}
    </div>
  );
}

export default App;
